import Link from 'next/link';
import React from 'react';

const Header = () => {
  return (
    <div>
      <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous"></link>
      <link href="https://fonts.googleapis.com/css?family=Open+Sans:300,400,600,700i,800" rel="stylesheet" />
      <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.7.2/css/all.css" integrity="sha384-fnmOCqbTlWIlj8LyTjo7mOUStjsKC4pOpQbqyi7RrhN7udi9RwhKkMHpvLbHG9Sr" crossorigin="anonymous"></link>
      <nav class="navbar navbar-expand-lg navbar-dark bg">
        <Link href="/">
          <a class="navbar-brand text-info">Home360</a>
        </Link>
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div class="navbar-nav">
            <a class="nav-item nav-link" href="#">About<span class="sr-only">(current)</span></a>
            <a class="nav-item nav-link" href="#">Contact us</a>
          </div>
        </div>
      </nav>
      <style>{`
        .bg {
          background: black;
        }
      `}</style>
    </div>
  )
}

export default Header;
